import Link from 'next/link';

const linkStyle = {
    marginRight: 15
}

const Navigation = props => (
    <Link href={props.page}>
        <a style={linkStyle}>{props.title}</a>
    </Link>
)

const Header = () => (
    <div>
        <Link href="/">
            <a style={linkStyle}>Home</a>
        </Link>
        <Navigation title="Creators" page="/creators"/>
        {/* <Link href="/creators">
            <a style={linkStyle}>Creators</a>
        </Link> */}
    </div>
);

export default Header;
